      SELECT DISTINCT ( + 10 ) AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - col0 >= + 41 * col2 * - + 66 / col0 + - - 32 - + - CAST ( NULL AS INTEGER ) * col1;
  - name: tab1

outputs:
  - name: q7242.out
    data: |
